import React from 'react';
import styled from 'styled-components';

import MenuNavItem from '.NavItem.js'

const Ul = styled.ul`
  display: flex;
  align-items: center;
  justify-content: center;
  height: 100%;
  width: 100%;
`

const MenuNavItems = ({ clicked }) => {
    let links = (
        <Ul>
            <MenuNavItem clicked = {clicked}> Food </MenuNavItem>
            <MenuNavItem clicked = {clicked}> Drinks </MenuNavItem>
        </Ul>
    )

    return links
}

export default MenuNavItems
